Page[18]=new Array("Gelişmiş Kağıt Seçimi, tek bir pencereden çeşitli kağıt özelliklerini seçmenize olanak sağlar. Kağıt özeti, seçimlerin bir özetini görüntüler.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Gelişmiş Kağıt Seçimi ile kağıt niteliklerini seçmek için:","Bir Adlı Kağıt için özellik eklemek veya güncellemek üzere, Kağıt'ın yanında, Adlı Kağıt'ı, ardından istediğiniz seçeneği belirtin.","Not: Yazdırma sürücüsü 10 adı tutar. 11. ad eklendiğinde en az kullanılan ad otomatik olarak listeden silinir. Listeden seçilen ad dışındaki adları kaldırmak için Listeyi Temizle'yi seçin.","Kağıt / Çıktı penceresinde, Kağıt'ın yanındaki okları tıklayın, ardından Gelişmiş Kağıt Seçimi'ni seçin.","Özellikler ayrı olarak ayarlamak için Yalnızca Ad Kullan (Uzman)'ın yanındaki onay kutusunu temizleyin.","Bir Kağıt Boyutu seçin veya özel bir kağıt boyutu oluşturmak için Özel'i tıklayın.","Bir Kağıt Rengi seçin veya özel bir kağıt rengi oluşturmak için Özel'i tıklayın.","Bir Kağıt Türü seçin veya özel bir kağıt türü oluşturmak için Özel'i tıklayın.","Bir Kağıt Ağırlığı (g/m2) seçin veya özel bir kağıt ağırlığı oluşturmak için Özel'i tıklayın.","Delikli Kağıt için bir seçenek belirtin.","Kaplamalı Taraflar için bir seçenek belirtin.","Kağıdın kaplaması yazdırılmış işin görünüşünü etkiler. Yazdırılmış işi kaplamak için Kaplamalı Taraflar'ı kullanın. Kağıdın bir yüzünü veya iki yüzünü birden kaplamayı seçebilirsiniz.","Kaplama Türü için bir seçenek belirtin.","Kaplamalı kağıtta kullanılan kaplama türünü belirtin. Kaplamanın türü yazdırılan dokümanın görünümünü etkileyebilir.","Zerre için bir seçenek belirtin.","Zerre, yazdırma işine ilişkin kağıt grenini belirtir. Bazı durumlarda, zerre, yazdırılan dokümanın görünümünü etkileyebilir.","Stok Sonlandırma için bir seçenek belirtin.","Stok Sonlandırma, yazdırma işiniz için son işlem türünü belirtmenize olanak tanır. Yazdırılan dokümanın görünümünü etkiler.","Açıklama için, Yazıcı Varsayılanı'nı seçin, listeden bir açıklama seçin veya yeni bir açıklama girin.","Seçimlerinizle ilgili isteğe bağlı bilgiler yakalamak için, Açıklama (İsteğe Bağlı) kısmında detayları girin.","Tamam düğmesini tıklatın.","Gelişmiş Kağıt Seçimi","advanced_paper_selection.html");
