Page[26]=new Array("Kare Katlama özelliği, kare katlanmış kitapçıkların sırtının katlamasını özelleştirmenize olanak tanır.","Kare Katlama seçeneklerini belirlemek için:","Kare Katlama penceresinde, Kare Katlama'nın yanında bir seçenek belirtin.","Daha kare şeklinde bir katlama belirlemek için Normal ile +2 arasında seçim yapın.","Daha yuvarlak bir kare belirlemek için Normal ile -2 arasında seçim yapın.","Kare Katlama özelliğini kapatmak için Kapalı'yı seçin.","Tamam düğmesini tıklatın.","Kare Katlama Son İşlemi","square_fold.html");
