Page[28]=new Array("Karton kapaklı bir kitap yazdırıp ciltlemek için Amerikan Cilt'i kullanın. Kapağı kitabın gövdesi etrafında yerleştirir ve yapıştırır. Ayrıca, kitabın kenarlarını istediğiniz boyuta gelecek şekilde kırpabilirsiniz.","Notlar: ","Bu seçenek yalnızca yazıcınızda uygun son işlemci takılıysa görünür. Kapaklar, zımbalama, delme, ciltleme, katlama veya kitapçık düzeni seçildiğinde görünmez.","Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Amerikan Cilt'i kullanmak için:","Kağıt / Çıktı penceresinde, Son İşlem'in yanındaki okları tıklayın, ardından Amerikan Cilt'i seçin.","Ciltleme Kenarı'nın yanında bir seçenek belirtin.","Dikey - Sol; Yönü dikey olarak ayarlar ve kitabı soldan ciltler.","Dikey - Sağ; Yönü dikey olarak ayarlar ve kitabı sağdan ciltler.","Yatay - Üst; Yönü yatay olarak ayarlar ve kitabı üstten ciltler.","Yatay - Alt: Yönü yatay olarak ayarlar ve kitabı alttan ciltler.","Kırpma'yı tıklatın, ardından bir seçenek seçin.","Kırpma Yok: Sayfaları kırpmaz.","Önalan veya Yüz: Ciltleme kenarının karşısındaki kenarı kırpar.","Tam Taşma: Kıpma Boyutunu etkinleştirerek bir kırpma boyutu seçmenize olanak sağlar. Tam Taşma, resmin kağıdın kenarına kadar yayılmasını sağlar.","Kırpma boyutu seçmek için Kırpma Boyutu'nu tıklatın, sonra da boyutlar listesinden seçim yapın veya Özel'i seçin.","Kapak kağıdı seçmek için, Kapak listesinde aşağıdaki seçenekleri belirleyin.","Adlı Kağıt: Listeden bir Adlı Kağıt seçmenize veya yeni bir Adlı Kağıt oluşturmanıza olanak tanır.","Diğer Boyut: Bu seçenek, kağıt boyutunu ayarlamanıza veya özel boyut oluşturmanıza olanak sağlar.","Diğer Renk: Kullanılabilir renkler listesinden seçim yapmanıza veya özel kağıt rengi oluşturmanıza olanak tanır.","Diğer Tür: Kağıt türünü seçmenize veya özel kağıt türleri oluşturmanıza olanak tanır.","Diğer Ağırlık: Kağıt ağırlığını seçmenize veya özel kağıt ağırlığı oluşturmanıza olanak tanır.","Gelişmiş Kağıt Seçenekleri: Kapağınız için gelişmiş kağıt özellikleri seçmenize olanak tanır.","Tamam düğmesini tıklatın.","Amerikan Cilt","perfect_binder.html");
