Page[30]=new Array("Doküman Son İşlemci Mimarisi (DFA) Son İşlemci Profilleri, yazıcıda ayarlanmış olan bir son işlemci profiline bağlanmanızı sağlar. Bir son işlemci için özel bir ad oluşturduğunuzda bu, yazdırma sürücüsünde görünür.","Yeni bir ad girmek için:","Kağıt / Çıktı penceresinde, Son İşlem'in yanındaki okları tıklayın, ardından Özel'i seçin.","Özel alanında, DFA son işlemci adını girin.","Tamam düğmesini tıklatın.","DFA Son İşlemci Profilleri","custom_finishing.html");
Page[31]=new Array("Kayma yapraklar, yazıcının harmanlı veya harmansız dokümanlara ilişkin tek bir yazdırma işinin birden çok kopyasını birbirinden ayormak için araya eklediği boş yapraklardır.","Yaprakları Kaydır seçeneklerini ayarlamak için:","Kağıt / Çıktı penceresinde, Son İşlem'in yanındaki okları tıklayın, ardından Yaprakları Kaydır'ı seçin.","Bir seçenek belirleyin:","Açık veya Etkin: Bir kayma yaprağı ekler.","Kapalı veya Devre dışı: Yaprakları kaydırmayı kapatır.","Tamam düğmesini tıklatın.","Yaprakları Kaydır","slip_sheets.html");
Page[32]=new Array("Ofset Çıktı, birden çok kopyalı yazdırma işlerinde kopyalara nasıl ofset uygulanacağını kontrol eder. Etkinleştirildiğinde, kopya takımları çıktı kasetinde birbirlerine göre biraz ofsetlenir. Bu seçenek, çıktı kasetinde ofset özelliği varsa kullanılabilir.","Ofset/Alt Küme'yi kullanmak için:","Kağıt / Çıktı penceresinde, Son İşlem'in yanındaki okları tıklayın, ardından Ofset/Alt Küme'yi seçin.","Bir seçenek belirleyin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Hiçbiri: Bu seçenek ofsetleri kapatır. Yine de alt kümeleri seçebilirsiniz.","Her Küme: Bu seçenek, birden çok kopyalı bir yazdırma işinde her kopyaya ofset uygular.","Her Alt Küme, tek bir kümede belirtilen sayıdaki sayfaya ofset uygular.","Her Küme ve Her Alt Küme, bir küme içinde belirtilen sayıdaki sayfaya ofset uygular, ayrıca birden çok kopyalı bir yazdırma işinde her kümeye ofset uygular.","Tek bir yazdırma işi içerisinde alt kümeler yazdırmak için, Altkümeleri Etkinleştir'i seçin.","Altküme Başına Sayfa'da, her bir doküman alt kümesine dahil edilecek sayfa sayısını girin. Her bir alt küme, aynı sayıda sayfa içermelidir.","Tamam düğmesini tıklatın.","Ofset/Alt Küme","offset_subset.html");
Page[33]=new Array("Bloknot, her bir formun yırtılarak ayrılmasını sağlayacak şekilde, tek sayfalı formlardan bloknotlar oluşturmanıza olanak sağlar. Normal olarak her bloknot bir karton arka kapağa ve sayfanın üst tarafında yapıştırıcı kullanılan bir ciltlemeye sahiptir.","Bloknotları yazdırmak için:","Kağıt / Çıktı penceresinde, Son İşlem'in yanındaki okları tıklayın, ardından Bloknotlar'ı seçin.","Bloknotlar'ın yanında bir seçenek belirtin.","Devre Dışı: Bloknot Oluşturma özelliğini kapatır.","Etkin: Bloknot yazdırmayı açar.","Bloknot Sayısı için aşağıdakilerden birini yapın:","Yazdırılacak bloknot sayısını yazın.","Yazıcıdaki varsayılan ayarı kullanmak için Yazıcı Varsayılanı'nı seçin.","Bloknot Başına Sayfa için aşağıdakilerden birini yapın:","Her bir bloknot için sayfa sayısını girin.","Yazıcıdaki varsayılan ayarı kullanmak için Yazıcı Varsayılanı'nı seçin.","Arka Kapak için, bloknotun arka kapak türünü seçin.","Kağıt için seçenekleri belirleyin.","Adlı Kağıt: Listeden bir Adlı Kağıt seçmenize veya yeni bir Adlı Kağıt oluşturmanıza olanak tanır.","Diğer Boyut: Bu seçenek, kağıt boyutunu ayarlamanıza veya özel boyut oluşturmanıza olanak sağlar.","Diğer Renk: Kullanılabilir renkler listesinden seçim yapmanıza veya özel kağıt rengi oluşturmanıza olanak tanır.","Diğer Tür: Kağıt türünü seçmenize veya özel kağıt türleri oluşturmanıza olanak tanır.","Diğer Ağırlık: Kağıt ağırlığını seçmenize veya özel kağıt ağırlığı oluşturmanıza olanak tanır.","Gelişmiş Kağıt Seçenekleri: Kapağınız için gelişmiş kağıt özellikleri seçmenize olanak tanır.","Tamam düğmesini tıklatın.","B.Not Oluşturma","pads.html");
Page[34]=new Array("Kitapçık özelliği iki sayfayı kağıdın bir tarafına yazdırır. Yazdırma sürücüsü sayfaları yeniden sıralar ve katlandıklarından sayısal sırada olacakları şekilde yönlendirir. Sayfalar bir kitapçık oluşturmak için zımbalanabilir. Bir kitapçık düzeninin, kağıdın her bir tarafında bir sayfa görüntüsü olan bir dokümanın düzeninden farklı olduğuna dikkat edin. Satır kaydırma ve sayfa ayrımları buna göre değişir.","Notlar: ","Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Kitapçık özelliğini kullanmak, genel sayfa görüntüsünü istenen kağıt boyutuna sığdırmak için küçültebilir.","Kitapçık oluşturmak için:","Kitapçık Oluşturma panelinde, Kitapçık Son İşlemi'nin yanındaki okları tıklayın, ardından bir seçenek belirleyin.","Kitapçık Son İşlemi Yok veya Kitapçık Katlama Yok: Bu özellik, yazdırma işi zımbalamaz veya katlamaz.","Kitapçık Katlama veya Katlama: Yazdırma işini merkez çizgisi boyunca katlar.","Kitapçık Katlama ve Zımbalama veya Katlama ve Zımbalama: Bu özellik, yazdırma işini merkez çizgisi boyunca katlar ve sayfaları yerinde tutmak için kat boyunca iki zımba uygular.","Kitapçık Düzenini Devre Dışı Bırak: Yazdırma işine kitapçık biçim seçeneklerini uygulamaz. Yazdırma işiniz halihazırda bir kitapçık olarak biçimlendirildiyse bu seçeneği kullanın.","Yazıcıyı, bir görüntüyü yeni bir kağıt boyutuna göre ölçeklendirmek üzere ayarlamak için Yeni Kağıt Boyutuna Ölçeklendir'in yanındaki okları tıklayın. İstediğiniz kağıt boyutunu seçin. Özel bir kağıt boyutu belirtmek için, Özel'i tıklayın.","Kenar boşluğu boyutlarını ayarlamak için Kitapçık Kenar Boşlukları'nın yanındaki okları tıklayıp bir seçenek belirleyin.","Standart, dokümanı standart kağıt boyutuna görüntü kaybı olmadan bir kitapçık olarak yazdırmak için sayfa görüntü boyutunu küçültür. Yazıcınız kağıt kenarına yazdıramıyorsa Standart'ı seçin.","Hiçbiri: Bu seçenek, dokümanı, sayfa görüntülerinin boyutunu küçültmeden bir kitapçık olarak yazdırır. Bu seçenek, yazıcı sayfa kenarına yazdıramıyorsa görüntüyü kırpabilir.","Not: Örnekte tabloid boyutlu bir yaprak üzerine yerleştirilmiş iki letter boyutlu sayfa gösterilmektedir. Soldaki görüntü Standart kenar boşluklarını kullanır. Sağdaki görüntü için Hiçbiri seçeneği belirlenmiştir.","Cilt payı ve kaymayı gerektiği şekilde belirleyin.","Cilt Payı: Sayfa görüntüleri arasındaki orta kenar boşluğunun genişliğini nokta cinsinden belirtir. Bir değer girin veya nokta sayısını seçmek için okları kullanın. Bir nokta 1/72 inç ya da 0,35 mm'dir","Kayma: Sayfa görüntüsünün dışa ne kadar (bir noktanın onda biri biriminde) kaydırılacağını belirtir. Sayfa görüntülerinin ne kadar kaydırılacağını belirlemek için bir değer girin veya değer seçmek için okları kullanın.","Tamam düğmesini tıklatın.","Kitapçık Oluşturma","booklet_creation.html");
Page[35]=new Array("Çıktı hedefi seçmek için:","Kağıt / Çıktı penceresinde, Çıktı Hedefi'nin yanındaki okları tıklayın, ardından bir seçenek belirtin.","Yazdırma işini, kağıt boyutu ve son işlem seçeneklerine göre bir hedefe göndermek için Yazıcı Varsayılanı'nı seçin.","Notlar: ","Diğer ayarlara bağlı olarak, bazı kağıt kasetleri kullanılamayabilir.","Yazıcınızda yalnızca bir çıktı hedefi varsa bu liste görünmez.","Çıktı Hedefi","output_destination.html");
Page[36]=new Array("Özel sayfalar, bir yazdırma işine eklenen kapaklar, ek sayfalar ve özel durum sayfalarıdır. Özel durum sayfaları yazdırma işindeki diğer sayfalardan farklı ayarlara sahiptir.","Kapak Ekleme","Ek Kağıtlar Ekleme","Özel Durum Ekleme","Özel Sayfaları Yönetme","Yazdırma işleriniz için önceden ayarlanmış Özel Sayfalar, Özel Sayfalar özet tablosunda görünür. Bu tablodan düzenlenecek ya da silinecek bir sayfa seçebilirsiniz. Ayrıca bir grup ek sayfanın sırasını değiştirebilirsiniz.","Girişleri düzenlemek, silmek veya taşımak için:","Kaydedilmiş sayfalar listesinde bir seçenek belirleyin. Düğmeler etkinleştirir.","İstediğiniz işlemi seçmek için düğmeleri tıklayın.","Özel Sayfalar","special_pages.html");
Page[37]=new Array("Her doküman kopyasına kapaklar eklemek ve kapak sayfası öz niteliklerini belirtmek için Kapaklar Ekle penceresini kullanın. İş Ayarı kutusu dokümanın ana gövdesinin sayfa ayarlarını gösterir. İş ayarlarını bir kapak özniteliği için kullanmak amacıyla İş Ayarlarını Kullan seçeneğini belirleyin.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Kapak eklemek için:","Özel Sayfalar penceresinde, Kapak Ekle'yi tıklayın.","Tüm ayarlar için iş varsayılanlarını kabul etmek üzere Tamam'ı tıklayın.","Seçim yapmak için, Kapak Seçenekleri listesinden bir kapak seçeneği belirleyin.","Kapak Yok önceki tüm Kapaklar ayarlarını iptal eder.","Yalnızca Ön: Bu seçenek, ilk sayfayı belirtilen kasetteki kağıda yazdırır. Otomatik 2 taraflı yazdırma ile, ilk iki sayfa kapağa yazdırılır.","Yalnızca Arka: Bu seçenek, arka sayfayı belirtilen kasetteki kağıda yazdırır. Otomatik 2 taraflı yazdırma ile, sayfa sayısı çift sayı olduğunda son iki sayfa kapağa yazdırılır.","Ön ve Arka: Aynı:. Bu seçenek ön ve arka kapakları aynı kasetten dahil yazdırır.","Ön ve Arka: Farklı: Farklı kasetlerdeki kağıtları kullanarak ön ve arka kapaklara yazdırır.","Boyut, renk veya kağıt türünü seçmek için, Ön veya Arka Kapak Sayfası'nın yanındaki okları tıklayıp seçenekleri belirleyin. ","Kapak yazdırma seçeneklerini belirleyin.","Boş veya Ön Yazdırılmış: Kapak için boş veya önceden yazdırılmış kağıt kullanır.","1. Tarafa Yazdır kapağın ön kısmına yazdırır.","2. Tarafa Yazdır: Kapak sayfasının 2. tarafına yazdırır.","İki Tarafa Yazdır: Kapak sayfasının her iki tarafına da yazdırır.","Tamam düğmesini tıklatın.","Kapaklar Ekle","add_covers.html");
Page[38]=new Array("Boş ya da önceden yazdırılmış bir ek kağıdı dokümanın ilk sayfasından önce ya da belirli sayfalardan sonra ekleyin. Örneğin bir dokümanda her bölümden sonra renkli bir boş kağıt eklemek için her bölümün sona erdiği sayfa numaralarını not edin. Bu sayfa numaralarını, bir ek sayfanın önüne gelecek sayfaları belirtmek için kullanın.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Ek kağıt eklemek için:","Özel Sayfalar penceresinde, Ek Kağıtları Ekle'yi tıklayın.","Ek Kağıt Seçeneği türünü seçin:","Sayfa 1'den Önce, ek kağıdı sayfa 1'den önce yerleştirir.","Sayfa(lar)dan Sonra: Sayfalardan sonra veya belirttiğiniz sayfa aralıklarından sonra araya bir ek kağıt yerleştirir.","Sayfa(lar)dan Sonra seçeneğini belirlerseniz, Sayfa(lar) alanında her bir ek kağıttan önceki sayfa numarasını girin.","Miktar alanında, gereken ek kağıt sayısını seçin.","Tüm ayarlar için iş varsayılanlarını kabul etmek üzere Tamam'ı tıklayın.","Boyut, renk veya türü seçmek için, Kağıt'ın yanındaki okları tıklayıp seçenekleri belirleyin.","Tamam düğmesini tıklatın.","Ek Kağıtlar Ekle","add_inserts.html");
Page[39]=new Array("Yazdırma işinizdeki özel durum sayfalarını belirtmek için Özel Durumlar Ekle'yi kullanın. Özel durum sayfaları işteki diğer sayfalardan farklı ayarlara sahiptir. Kağıt boyutu, sayfa türü ve sayfa rengi gibi farklılıklar belirtebilirsiniz. İşinizin gerektirdiği şekilde, sayfanın yazdırılacağı tarafı da değiştirebilirsiniz. Bir yazdırma işi birden fazla özel durum sayfası içerebilir.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Kağıt Çıkışı Özel Durumları","Özel Sayfalar penceresinde, Özel Durumlar Ekle'yi tıklayın.","Sayfa(lar) için özel durum uygulanacak kağıdı ya da kağıtları belirtin. Sayfayı teker teker veya sayfa aralıkları olarak virgülle ayırın. Bir aralık dahilindeki sayfaları kısa çizgi ile belirtin. Örneğin, 1, 6, 9, 10 ve 11. sayfaları belirtmek için 1, 6, 9-11 yazın.","Tüm ayarlar için iş varsayılanlarını kabul etmek üzere Tamam'ı tıklayın.","Boyut, renk, tür veya ağırlığı seçmek için, Kağıt'ın yanındaki okları tıklayıp seçenekleri belirleyin.","Kağıt Türü için Ön Kesimli Sekmeler'i seçerseniz, Numara Sırasında alanına sekme sayısını girin.","Kağıt türü için Sıralandı'yı seçerseniz, kağıt türü adını ve sıradaki numarasını girin.","Yazdırılacak kağıt taraflarını değiştirmek için 2 Taraflı Yazdırma altında bir seçenek belirleyin:","1- Taraflı Yazdırma: Özel durum sayfalarını yalnızca tek bir tarafa yazdırır.","2-Taraflı Yazdırma: Özel durum sayfalarını, kağıdın her iki tarafına yazdırır ve sayfaları uzun kenar üzerinde döndürür. Daha sonra, iş, sayfaların uzun kenarından ciltlenebilir.","2-Taraflı Yazdırma, Kısa Kenardan Çevir: Özel durum sayfalarını, kağıdın her iki tarafına yazdırır ve sayfaları kısa kenar üzerinde döndürür. Daha sonra, iş, sayfaların kısa kenarından ciltlenebilir.","Çıktı Rengi için bir seçenek belirleyin.","Tamam düğmesini tıklatın.","Görüntü Seçenekleri Özel Durumları","Görüntü Seçenekleri penceresi, yazdırılan dokümanların görünümünde değişiklik yapmanıza olanak tanır.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Renkli","Renksiz Kuru Mürekkep veya Nesne Temelli Temizleme","Renksiz Kuru Mürekkep, yazdırılan görüntünüzün bir fotoğraf gibi görünmesini sağlamak veya bir görüntü, metin veya grafiği vurgulamak için kullanılabilir.","Not: Listelenen tüm seçenekler tüm yazıcılarda desteklenmez. Bazı seçenekler yalnızca belirli bir yazıcı modeli, yapılandırma, işletim sistemi ya da sürücü türü için geçerlidir.","Renksiz Kuru Mürekkep'i kullanmak için:","Kuru Mürekkebi Temizle penceresinde, Temizleme Seçenekleri için bir seçeneğini belirleyin.","Yazıcı Varsayılanı: Geçerli yazıcı ayarlarını kullanır.","Akış Renksiz: Sayfanın tamamını renksiz tonerle kaplar.","Yalnızca Görüntüler: Yalnızca görüntü olarak tanımlanan sayfa nesnelerini kapsar.","Yalnızca Metin: Yalnızca metni renksiz tonerle kaplar.","Yalnızca Grafikler: Yalnızca grafikleri renksiz tonerle kaplar.","Görüntüler Yok (Yalnızca Metin, Grafik): Bütün sayfayı, metin veya grafikleri, görüntüleri atlayarak renksiz tonerle kaplar.","Metin Yok (Yalnızca Görüntüler, Grafik): Sayfanın tamamını, görüntüleri ve grafikleri metinleri atlayarak renksiz tonerle kaplar.","Grafik Yok (Yalnızca Görüntüler, Metin): Sayfanın tamamını, görüntüleri ve metni grafikleri atlayarak renksiz tonerle kaplar.","Temizlemeyi Bastır: Sayfanın herhangi bir bölümünün renksiz tonerle kaplanmasını önler.","Katıştırılmış Temizlemeyi Kullan: Yazıcı PDL'de yer alan talimatları kuru mürekkebi temizlemek için kullanır.","Yazıcı, Sayfa Tanımı Dilini (PDL) yazdırılan bir sayfa oluşturmak için  kullanır. PDL'ler PostScript (PS) ve Yazıcı Komut Dilini (PCL) kullanır.","Renksiz toner miktarını belirlemek için, Temizleme Miktarı'nın yanındaki okları tıklayıp bir seçenek belirtin.","Tamam düğmesini tıklatın.","Düzgünleştirme","Düzgünleştirme, görüntüler ve metindeki pürüzlü görünümü yumuşatır.","Bir düzgünleştirme seçeneği belirlemek için:","Görüntü Seçenekleri penceresinde, Düzgünleştirme için bir seçenek belirtin.","Yazıcı Varsayılanı: Geçerli yazıcı ayarlarını kullanır.","Açık: Düzgünleştirme'yi açar.","Kapalı: Düzgünleştirme'yi kapatır.","K100%Yüksek Çözünürlük: Net, güçlü bir siyah renk kullanır. Bu özelliği, güçlü siyah bloklar içeren ince metin veya grafikler için kullanabilirsiniz.","Kullanıcı TRC'leri  ","Ton Çoğaltma Eğrileri (TRC), yazdırılan görüntünün renk tutarlılığını korur. Kullanıcı TRC'leri, yazdırılan renklerinde ton çoğaltma eğrilerini ayarlayarak hassas ayar yapmanıza olanak sağlar.","TRC kullanarak yazdırmak için:","Görüntü Seçenekleri penceresinde, Kullanıcı TRC'leri için bir seçenek belirtin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Girilen son 10 TRC adından oluşan listeden bir ad seçin.","Yeni bir ad girin.","Çözünürlük","Çözünürlük grafik görüntülerin kalitesini belirler. Resim çözünürlüğü inç başına nokta sayısıyla (dpi) ölçülür. 600 dpi'lik bir ayar, resmi her inç için 600 nokta (piksel) kullanarak işler. Çözünürlük yükseldikçe yazdırma kalitesi artar.","Çözünürlük belirlemek için, Çözünürlük'ü tıklayın, ardından bir seçenek belirleyin veya Yazıcı Varsayılanı'nı seçin.","Yarım Ton Ekranı","Yarım Ton bir yazdırma yöntemidir; küçük noktaların bağıl koyuluk, yoğunluk ve boyutu, renkteki ve parlaklıktaki değişimleri göstermek için değiştirilir. Bir yarım ton tarafından gösterilen ayrıntının miktarı, nokta/inç sayısına göre değişir, bu sayı arttıkça baskıdaki ayrıntı da artar. Bir yarım ton bazen bir ekran olarak adlandırılır.","Tahmini yarım ton ekran, noktaların yoğunluğunu istenilen gri düzeyine göre belirlediğiniz rastgele dağılımı temel alan bir işlem kullanır. Tahmini, moire desenlerinin oluşumunu önlemek üzere tasarlanmıştır. Tahmini yarım ton ekranının rasgele niteliği, fotoğraflarda özellikle etkisini kanıtlar.","Yarım Ton Ekran seçeneklerini belirlemek için:","Görüntü Seçenekleri penceresinde, Yarım Ton Ekran'ı tıklayıp bir seçenek belirtin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Bir değer seçin. Ne kadar çok nokta, çizgi veya inç başına çizgi (lpi) seçerseniz yazdırma işinde o kadar çok ayrıntı olur.","Tahmini'yi seçin.","Toner Tasarrufu","Toner Tasarrufu, yazdırma işlerinde kullanılan toner miktarını azaltır ve taslak kalitesinde çıktılar için kullanışlıdır. Baskı kalitesi, Standart'tan biraz daha düşüktür.","Toner Tasarrufu'nu açmak için, Görüntü Seçenekleri penceresinde, Toner Tasarrufu'nun yanındaki okları tıklayın, ardından Açık'ı seçin.","Görüntü Kaydır","Görüntü Kaydır, görüntünün sayfadaki konumunu değiştirmenizi sağlar. Yazdırılan görüntüyü, her bir yaprak kağıt üzerinde X  ve Y ekseni üzerinde kaydırabilirsiniz.","Görüntü Kaydırma seçeneklerini ayarlamak için:","Görüntü Kaydırma Seçenekleri yanındaki okları kullanıp bir seçenek belirtin.","Kağıt Çıkışı penceresinde 1 Taraflı Yazdırma'yı seçerseniz, Görüntü Kaydırma Seçenekleri için bir seçenek belirtin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Bağımsız: Ayarları manuel olarak ayarlamanıza olanak tanır.","Kağıt Çıkışı penceresinde 2 Taraflı Yazdırma'yı seçerseniz, Görüntü Kaydırma Seçenekleri için bir seçenek belirtin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Bağımsız: Ayarları manuel olarak ayarlamanıza olanak tanır.","Ayna X: Her iki taraftaki görüntüleri eşit mesafede ancak X ekseni boyunca ters yönlerde aynı anda taşımanıza olanak tanır.","Ayna Y: Her iki taraftaki görüntüleri eşit mesafede ancak Y ekseni boyunca ters yönlerde aynı anda taşımanıza olanak tanır.","Ayna Her İkisi: Her iki taraftaki görüntüleri eşit mesafede ancak X ve Y ekseni boyunca ters yönlerde aynı anda taşımanıza olanak tanır.","Ayna X, Tandem Y: Her iki taraftaki görüntüleri eşit mesafede, X ekseni boyunca ters yönlerde ve Y ekseni boyunca aynı yönde aynı anda taşımanıza olanak tanır.","Ayna Y, Tandem X: Her iki taraftaki görüntüleri eşit mesafede, Y ekseni boyunca ters yönlerde ve X ekseni boyunca aynı yönde aynı anda taşımanıza olanak tanır.","Tandem X: Her iki taraftaki görüntüleri eşit mesafede ve X ekseni boyunca aynı yönde aynı anda taşımanıza olanak tanır.","Tandem Y: Her iki taraftaki görüntüleri eşit mesafede ve Y ekseni boyunca aynı yönde aynı anda taşımanıza olanak tanır.","Tandem Her İkisi: Her iki taraftaki görüntüleri eşit mesafede ve X ve Y ekseni boyunca aynı yönde aynı anda taşımanıza olanak tanır.","Bağımsız için aşağıdakilerden birini yapın:","1. Taraf için, sayfa görüntüsünü  X  ve Y ekseni üzerinde kaydırmak üzere bir değer girin.","2. Taraf kullanılabilirse, sayfa görüntüsünü X ve Y ekseni üzerinde kaydırmak için bir miktar girin.","Not: 2. Taraf seçeneği sadece 2 Taraflı Yazdırma'yı seçerseniz kullanılabilir.","Tamam düğmesini tıklatın.","Vurgu Rengi","Vurgu Rengi, yazdırılmış çıktının önemli metinleri veya bölümlerini öne çıkarmanıza olanak sağlar.","Vurgulama yöntemlerini seçmek için:","Görüntü Seçenekleri penceresinde, Rengi Vurgula'yı tıklayın.","Bir seçenek belirleyin.","Yazıcı Varsayılanı: Varsayılan yazıcı ayarlarını kullanır.","Eşleme Algoritması: Eşleme Rengi Vurgusu'nda seçtiğiniz renk dışında tüm diğer renklerin nasıl yazdırılacağını belirler. Seçimler, farklı sonuçlar için farklı algoritmalar uygular.","Eşleme Rengi Vurgusu: Vurgulanacak belirli rengi seçer.","Yazdırma Rengi Vurgusu: Dokümanı seçtiğiniz renkte yazdırır.","Uyumsuzluk İlkesi: Seçilen renk ile yazıcı renk özellikleri arasındaki uyumsuzlukların nasıl ele alınacağını belirtir.","Açıklık","Özel Durumlar Ekle","add_exceptions.html");
