Page[66]=new Array("OPI Yerine Koyma, dokümanı yazdırırken düşük çözünürlüklü taslak görüntüleri veya resim yer tutucularını yüksek çözünürlüklü görüntülerle değiştirir. Bu yerine koyma işlemi, yazdırma sunucusu depolama alanından ve ağ kaynaklarından tasarruf sağlayabilir.","OPI Yerine Koyma seçeneklerini ayarlamak için:","Gelişmiş penceresinde, OPI Yerine Koyma'nın yanındaki okları tıklayın, ardından bir seçenek belirtin.","Yazıcı Varsayılanı: Geçerli yazıcı ayarlarını kullanır.","Etkin: Yazdırma sunucusuna, OPI açıklamalarını işlemesini ve yazdırılan dokümandaki düşük çözünürlüklü görüntüleri yüksek çözünürlüklü görüntülerle değiştirmesi talimatını verir.","Devre Dışı: OPI Yerine Koyma özelliğini kapatır.","OPI Yerine Koyma","opi_substitution.html");
